function App() {
  return (
<BrowserRouter>
<Routes>
  <Route path="/" element={<DataDisplay/>}/>
  <Route  element={<PrivateRoute />}>
  <Route path="/page-1" element={<Page1/>}/>
  <Route path="/page-2" element={<Page2/>}/>
  </Route>

</Routes>
</BrowserRouter>
  );
}

export default App;
